import { useEffect, useState } from 'react';
import { endPoints, getVideoList, Video } from '../../data/api/videoApi';
import Movies from '../comp/display/movies/Movies';

export default function MainPage() {
  const [list, setList] = useState<{
    originals: Video[];
    popular: Video[];
  }>;

  useEffect(() => {
    getVideoList(endPoints.originals).then((data: Video[]) => {
      setList({ ...list, originals: data });
    });
  }, []);

  return (
    <>
      <Movies title='Netflix originals' movies={list.originals} />
      <Movies title='Netflix originals' movies={list.popular} />
    </>
  );
}
